Novy rocnik FIFA 07  kompletne v CZ...

Na pomery EA az prekvapive dobry fotbal, ktery se zaroven bude libit jak starym hracum, tak i novackum.




VYLEPSENA HRA: Doslo ke zlepseni prihravek a pohybu hracu v poli. Pri souboji o mic se hraci realisticky strkaji a narazeji do sebe. Mic presne reaguje na hracuv impuls. Pocitacovi hraci pouzivaji typicke pohyby a hracske styly skutecnych fotbalovych hvezd.

